function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/" exact component={Home} /> {/* Usa Home aquí */}
          {/* Futuras rutas aquí */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
